import React from 'react';

class Overlay extends React.Component {
    render() {
        return (
            <div className="overlay">
                <div className="overlay-content">
                    <span className="close">&times;</span>
                    <p>Some text in the Modal..</p>
                </div>
            </div>
        )
    }
}

export default Overlay;
